"Как потратить бонусы?"

Вы можете потратить бонусы на следующие услуги:

1. Пополнение баланса на свой счет;
2. Приобретение билетов на любые лотереи;
3. Приобретение подарочных сертификатов на любые лотереи;
4. Приобретение товаров в магазине "Лото-магнит".

Для этого вам нужно зайти в личный кабинет и выбрать нужную услугу. После этого будет открыт соответствующий формат оплаты.

