"Как потратить бонусы?"

Вы можете потратить бонусные баллы на следующие услуги:
1. Получение бонусов за участие в акциях и конкурсах;
2. Получение бонусов за рекомендации друзей;
3. Получение бонусов за выполнение заданий и миссий;
4. Получение бонусов за активное использование сервиса (например, за совершение определенного количества транзакций);
5. Получение бонусов за отзывы и рейтинг других пользователей.
